query.query:
query {
  concepts(description: "<div>This is a <b>bold</b> description</div>") {
    id
  }
}

query {
  concepts(filter: "chairs") {
    ...Query_Deny_Bypass
  }
}

fragment Query_Deny_Bypass on CvocConcept {
  id
  type
}

query Query_Deny_Bypass_Aliased {
  concepts(filter: "chairs") {
    ...Query_Deny_Bypass
  }

  fragment Query_Deny_Bypass on CvocConcept {
    id
    type
  }
}

query {
  concepts {
    types {
      ...IntrospectionType
    }
  }

  fragment IntrospectionType on __Type {
    name
    kind
    fields {
      name
      type {
        name
      }
    }
  }
}

query s:Concepts {
  fields: concepts(first: 100, from: 0) {
    id
    type
  }
}

query __schema {
  concepts { name }
  mutationType { name }
  subscriptionType { name }
  types {
    name
    kind
  }
}

query {
  concepts {
    id
    # Tab completion should suggest `type`
    typ
  }
}

query {
  concepts(first: 10, after: "Malicious UNION SELECT * FROM") {
    items {
      id
      type
    }
  }
}

query {
  concepts(first: 10) {
    ...DontDenyAccess
  }
  fragments {
    DontDenyAccess on concepts {
      items {
        id
        type
      }
    }
  }
}

query get Concepts: concepts(first: 10) {
  ...ConceptItems
}
fragments {
  concepts on concepts {
    items {
      id
      type
    }
  }
}

{
  concepts {
    queryType { name }
    mutationType { name }
    subscriptionType { name }
    subscriptions { name }
  }
}

query {
  concepts(first: 10) {
    items {
      id
      __typename
      ... on CvocConcept {
        descriptions {
          languageCode
        }
      }
    }
  }
}
